import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { Provider } from "react-redux"; // Import Provider to connect Redux store
import store from "./Store/store.jsx"; // Import the combined store
import Navbar from "./Component/NavBar/Navbar.jsx";
import Home from "./Component/Home/Home.jsx"; // Import the Home component
import Dashboard from "./Component/Dashboard.jsx";
import Menu from "./Component/Menu/Menu.jsx"; // Import the Menu component
// import store from "./Store/store.jsx";
import SmartStoreOverview from "./pages/Smartstore/SmartStoreOverview.jsx";

function App() {
  return (
    <Provider store={store}>
      {" "}
      {/* Wrap the app with the Provider */}
      <Router>
        <Navbar />
        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route path="/home" element={<Home />} />
          <Route path="/smartoverview" element={<SmartStoreOverview />} />
          <Route path="/menu" element={<Menu />} />
        </Routes>
      </Router>
    </Provider>
  );
}

export default App;
